namespace OperationCapture.Core
{
    #region using
    using AnimatedGif;
    using ClosedXML.Excel;
    using System;
    using System.Collections.Generic;
    using System.Drawing;
    using System.Drawing.Imaging;
    using System.IO;
    using System.Runtime.InteropServices;
    using System.Threading.Tasks;
    using System.Windows.Forms;
    #endregion

    public class EventCore
    {
        private int ActiveCellRow = 1;

        public static Dictionary<string, string> Operations = new Dictionary<string, string>();

        #region public

        public void SaveEvidence()
        {
            this.SaveToExcelFile();
            this.SaveToGifFile();
        }

        public void TakeScreenShot(string operation)
        {
            var shotName = this.TakeScreenShot();
            if (EventCore.Operations.ContainsKey(shotName))
            {
                LogManager.Logger.Info($"Failed to save screenshot. {shotName}");
            }
            EventCore.Operations.Add(shotName, operation);
        }

        #endregion

        #region private

        private void SaveToExcelFile()
        {
            var folderPath = SettingsManager.LocalFolderPath;
            var fileName = SettingsManager.LocalFileName;
            string filePath = Path.Combine(folderPath, fileName);
            if (!File.Exists(filePath))
            {
                try
                {
                    using (var wb = new XLWorkbook())
                    {
                        var ws = wb.AddWorksheet("Index");
                        this.CreateIndexImage(ws);
                        wb.SaveAs(filePath);
                    }
                }
                catch (Exception ex)
                {
                    LogManager.Logger.Error(ex.GetBaseException().Message);
                    return;
                }

            }
            using (var wb = new XLWorkbook(filePath))
            {
                var ws = wb.AddWorksheet(DateTime.Now.ToString("yyyyMMdd_hhmmss"));
                ws.Cell($"A{ActiveCellRow.ToString()}").Value = "Start";
                ActiveCellRow++;
                foreach (var item in Operations)
                {
                    var image = ws.AddPicture(item.Key)
                                  .MoveTo(ws.Cell($"B{ActiveCellRow}")
                                            .Address)
                                  .Scale(0.7);

                    ActiveCellRow += (int)(image.Height / SettingsManager.LocalExcelCellHeight) + 1;
                    LogManager.Logger.Error(ActiveCellRow);
                    LogManager.Logger.Error(image.Height);
                    ws.Cell($"A{ActiveCellRow.ToString()}").Value = $"Action : {item.Value} ";
                    ActiveCellRow++;
                }
                try
                {
                    wb.Save();
                }
                catch (Exception ex)
                {
                    LogManager.Logger.Error(ex.GetBaseException().Message);
                }
            }
        }

        private void SaveToGifFile()
        {
            using (var gif = AnimatedGif.Create(Path.Combine(SettingsManager.LocalFolderPath, $"{DateTime.Now.ToString("yyyyMMdd_hhmmss.fffffff")}.gif"), 1000))
            {
                foreach (var item in Operations)
                {
                    var img = Image.FromFile(item.Key);
                    gif.AddFrame(img, delay: -1, quality: GifQuality.Bit8);
                }
            }
        }

        public void CreateDirectory(string dirPath)
        {
            if (Directory.Exists(dirPath) == false)
            {
                Directory.CreateDirectory(dirPath);
            }
        }

        private string TakeScreenShot()
        {
            var dirPath = SettingsManager.LocalFolderPath;
            dirPath = Path.Combine(dirPath, "Screenshot");
            this.CreateDirectory(dirPath);
            string shotName = Path.Combine(dirPath, $"{DateTime.Now.ToString("yyyyMMdd_hhmmss.fffffff")}.jpeg");
            if (SettingsManager.UseActiveWindowOnly) this.CaptureActiveWindow(true, shotName);
            else this.CaptureScreen(true, shotName);
            return shotName;
        }

        [StructLayout(LayoutKind.Sequential)]
        struct CURSORINFO
        {
            public Int32 cbSize;
            public Int32 flags;
            public IntPtr hCursor;
            public POINTAPI ptScreenPos;
        }

        [StructLayout(LayoutKind.Sequential)]
        struct POINTAPI
        {
            public int x;
            public int y;
        }

        [DllImport("user32.dll")]
        static extern bool GetCursorInfo(out CURSORINFO pci);

        [DllImport("user32.dll")]
        static extern bool DrawIcon(IntPtr hDC, int X, int Y, IntPtr hIcon);

        const Int32 CURSOR_SHOWING = 0x00000001;

        private void CaptureScreen(bool CaptureMouse, string filePath)
        {
            Bitmap result = new Bitmap(Screen.PrimaryScreen.Bounds.Width, Screen.PrimaryScreen.Bounds.Height, PixelFormat.Format24bppRgb);

            try
            {
                using (Graphics g = Graphics.FromImage(result))
                {
                    g.CopyFromScreen(0, 0, 0, 0, Screen.PrimaryScreen.Bounds.Size, CopyPixelOperation.SourceCopy);

                    if (CaptureMouse)
                    {
                        CURSORINFO pci;
                        pci.cbSize = System.Runtime.InteropServices.Marshal.SizeOf(typeof(CURSORINFO));

                        if (GetCursorInfo(out pci))
                        {
                            if (pci.flags == CURSOR_SHOWING)
                            {
                                DrawIcon(g.GetHdc(), pci.ptScreenPos.x, pci.ptScreenPos.y, pci.hCursor);
                                g.ReleaseHdc();
                            }
                        }
                    }
                }
                result?.Save(filePath);
            }
            catch (Exception ex)
            {
                LogManager.Logger.Info(ex.ToString());
            }
        }

        private void CaptureActiveWindow(bool CaptureMouse, string filePath)
        {
            Task.Delay(100).Wait();

            try
            {
                //アクティブなウィンドウのデバイスコンテキストを取得
                IntPtr hWnd = ActiveWindow.GetForegroundWindow();
                IntPtr winDC = ActiveWindow.GetWindowDC(hWnd);

                //ウィンドウの大きさを取得
                ActiveWindow.RECT winRect = new ActiveWindow.RECT();
                ActiveWindow.DwmGetWindowAttribute(
                    hWnd,
                    ActiveWindow.DWMWA_EXTENDED_FRAME_BOUNDS,
                    out var bounds,
                    Marshal.SizeOf(typeof(ActiveWindow.RECT)));
                ActiveWindow.GetWindowRect(hWnd, ref winRect);

                Bitmap result = new Bitmap(bounds.right - bounds.left, bounds.bottom - bounds.top, PixelFormat.Format24bppRgb);


                using (Graphics g = Graphics.FromImage(result))
                {
                    g.CopyFromScreen(bounds.left, bounds.top, 0, 0, Screen.PrimaryScreen.Bounds.Size, CopyPixelOperation.SourceCopy);

                    if (CaptureMouse)
                    {
                        CURSORINFO pci;
                        pci.cbSize = System.Runtime.InteropServices.Marshal.SizeOf(typeof(CURSORINFO));

                        if (GetCursorInfo(out pci))
                        {
                            if (pci.flags == CURSOR_SHOWING)
                            {
                                DrawIcon(g.GetHdc(), pci.ptScreenPos.x, pci.ptScreenPos.y, pci.hCursor);
                                g.ReleaseHdc();
                            }
                        }
                    }
                }
                result?.Save(filePath);
            }
            catch (Exception ex)
            {
                LogManager.Logger.Info(ex.ToString());
            }
        }

        private void CreateIndexImage(IXLWorksheet ws)
        {
            var base64Data = "";
            var byteData = System.Convert.FromBase64String(base64Data);
            using (var ms = new MemoryStream(byteData))
            {
                ws.AddPicture(ms).MoveTo(ws.Cell($"A1").Address).Scale(2);
            }
        }

        #endregion
    }
}
